def get_stats(data, header):
    df0 = data
    fig, axes = plt.subplots(nrows=6, ncols=3, figsize=(15, 25))
    plt.subplots_adjust(wspace=0.20, hspace=0.20, top=0.97)
    plt.suptitle(header, fontsize=20)

    # Marginal feature distributions compared for disease and no-disease (likelihoods)
    # bins = np.linspace(20, 80, 15)

    sns.countplot(x="sex", data=df0, ax=axes[0, 0])
    axes[0, 0].set(xlabel='Sex (0=female, 1=male')

    sns.distplot(df0['age'], bins=20, ax=axes[0, 1])
    axes[0, 1].set_xlabel("Age")

    sns.countplot(x="sd", data=df0, ax=axes[0, 2])
    axes[0, 2].set_xlabel("Sd")

    sns.countplot(x="condition", data=df0, ax=axes[1, 0])
    axes[1, 0].set_xlabel("Condition (0=worst, 4=best)")

    # sns.distplot(df0['timedelta'], bins=20, ax=axes[1, 1])
    # axes[1, 1].set_xlabel("Timedelta (hours)")

    sns.distplot(df0['Troponin'], bins=20, ax=axes[1, 1])
    axes[1, 1].set_xlabel("Troponin level")

    sns.distplot(df0['RBC'], bins=20, ax=axes[1, 2])
    axes[1, 2].set_xlabel("RBC level")

    sns.distplot(df0['WBC'], bins=20, ax=axes[2, 0])
    axes[2, 0].set_xlabel("WBC level")

    sns.distplot(df0['HGB'], bins=20, ax=axes[2, 1])
    axes[2, 1].set_xlabel("HGB level")

    sns.distplot(df0['HCT'], bins=20, ax=axes[2, 2])
    axes[2, 2].set_xlabel("HCT level")

    sns.distplot(df0['PLT'], bins=20, ax=axes[3, 0])
    axes[3, 0].set_xlabel("PLT level")

    sns.distplot(df0['AST'], bins=20, ax=axes[3, 1])
    axes[3, 1].set_xlabel("AST level")

    sns.distplot(df0['ALT'], bins=20, ax=axes[3, 2])
    axes[3, 2].set_xlabel("ALT level")

    sns.distplot(df0['Kreatinin'], bins=20, ax=axes[4, 0])
    axes[4, 0].set_xlabel("Kreatinin level")

    sns.distplot(df0['Glucose'], bins=20, ax=axes[4, 1])
    axes[4, 1].set_xlabel("Glucose level")

    sns.distplot(df0['Holesterin'], bins=20, ax=axes[4, 2])
    axes[4, 2].set_xlabel("Holesterin level")

    sns.distplot(df0['pressure'], bins=20, ax=axes[5, 0])
    axes[5, 0].set_xlabel("Pressure level")

    axes[5, 1].axis("off")
    axes[5, 2].axis("off")
    plt.savefig(header + '.png')


def intrinsic_discrepancy(x,y):
    assert len(x)==len(y)
    sumx = sum(xval for xval in x)
    sumy = sum(yval for yval in y)
    id1 = 0.0
    id2 = 0.0
    for (xval,yval) in zip(x,y):
        if (xval>0) and (yval>0):
            id1 += (float(xval)/sumx) * np.log((float(xval)/sumx)/(float(yval)/sumy))
            id2 += (float(yval)/sumy) * np.log((float(yval)/sumy)/(float(xval)/sumx))
    return min(id1,id2)


